import { useParams } from "react-router-dom"
import { Patient } from "../../types"


const PatientToShow = ({patients} : {patients: Patient[]} ) => {
    const id = useParams().id


    const patient: Patient | null = patients.find(patient => Number(patient.id) === Number(id)) || null


    return (
<div>
    {patient && patient.name}
</div>
    )

}


export default PatientToShow
